<node COLOR="#990000" CREATED="1600750362048" ID="ID_1721185368" MODIFIED="1602182873612" TEXT="Create an outline of what I want to say, then fill in the outline with the resume.&#xa;&#xa;In a Product Manager resume, I should just have ScrumMaster responsibilities as a last bullet is why.  I am too technical or too whatever most of the time, but this way I can change that.&#xa;&#xa;&#x9;* 5+ years of software product management experience in an agile environment.&#xa;&#x9;* Proven track record of managing all aspects of a successful product throughout its lifecycle.&#xa;&#x9;* Solid technical background with understanding and/or hands-on experience with agile software development tools and SaaS technologies and solutions.&#xa;&#x9;* Strong problem solving skills and willingness to roll up one&#x2019;s sleeves to get the job done.&#xa;&#x9;* The ability to work under pressure and be able to prioritize to meet deadlines and quickly shift priorities as necessary.&#xa;&#x9;* The ability to influence cross-functional teams without formal authority.&#xa;&#x9;* Exceptional analytical reasoning skills.&#xa;&#x9;* Polished communication skills including the ability to deliver persuasive presentations to senior executives, partners and customer stakeholders.&#xa;&#x9;* 2+ years of experience and passion for mobile and consumer technology.&#xa;&#x9;* MS/BS Degree in Computer Science or equivalent work experience.&#xa;&#x9;* Defining product strategy and vision, delivering high impact products in a fast paced environment.&#xa;&#x9;* Specifying market and functional requirements for current and future products by conducting market research supported by on-going discussions with internal and external customers.&#xa;&#x9;* Managing the entire product life cycle from strategic planning to tactical activities for your product.&#xa;&#x9;* Driving a solution set across development teams (primarily Development/Engineering, Product Marketing and Support) by translating the solution vision into clearly articulated end-to-end use cases and user stories? and reviewing and approving product designs and deliverables.&#xa;&#x9;* Leading Agile teams throughout the development process as a product owner.&#xa;&#x9;* Working with customers and other Parchment resources to prioritize requirements to successfully meet the goals of the business.&#xa;&#x9;* Working with product marketing to develop a company-wide go-to-market plan.&#xa;&#x9;* CEO of your product&#xa;&#x9;* drive profitability&#xa;&#x9;* guide your team to develop new solutions and increase customer satisfaction with existing solutions&#xa;&#x9;* enjoy spending time with customers to understand market problems and personas&#xa;&#x9;* manage our multi-million education marketing line growing it at 100%+ year over year&#xa;&#x9;* work with marketing communications to define the go-to-market strategy&#xa;&#x9;* internal and external expert and evangelist for your product offering, occasionally working with the sales channel and key customers.">
<edge COLOR="#111111" WIDTH="thin"/>
<font NAME="SansSerif" SIZE="14"/>
</node>
</node>
